import axios from "axios";

const feature = (url, method, type = "json") => {
  return new Promise(() => {
    switch (method) {
      case "get":
        axios(url, { responseType: type })
          .then((res) => {
            console.log(res.data);
            return 1;
          })
          .catch((err) => console.log(err));
        break;
      case "post":
        console.log("get");
        break;
      case "put":
        console.log("get");
        break;
      case "delete":
        console.log("get");
        break;
      default:
        console.log("not");
        break;
    }
  });
};

export default feature;
